B.MV=new A.f4("Muhammad Aminxo'ja Muqimiy 1850 yilda Qo\u2018qonda novvoy oilasida tug\u2018ildi. Uning otasi Mirzaxojja asli toshkentlik bollib, 1835\u201436 yillarda bu yerda avj olib ketgan ichki urushlar zarbidan qochib, o'z otasi Mirfozil bilan birgalikda Qo'qonga ko'chib boradi va shu yerda turg\u2019un bollib goladi. \n\nMuhammad Aminxojaning onasi Bibioysha, asi xojandlik bolib, Saydolim Nodirshayx qizidir. Saydolim Nodirshayx qizidir ham Mirzaxojalar oilasi singari, turmush-tirikchilik tagqozosi bilan Qo\u2018qonga kelib, u yerda turg\u2018un bollib qolganlardan edi. \n\nMirzaxojja bilan Bibioysha o'z turmushlarida beshta farzand ko'rganlar. Ularning uchinchi ogil \u2014 Muhammad Aminxojja edi. Muqimiy boshlang\u2018ich ma'lumotini zamonining sxolastika asosiga qurilgan oddiy maktablaridan birida oldi. Maktab Mugimiyni savodga o'rgatdi, lekin unda_ badiiy zavqni tarbiyalagan \u2014 onlar bo'ldi. Muqimiyning yoshlik davridagi oila tarbiyasida uning onasi katta rol o'ynadi. Mugimiyning onasi Bibioysha alohida fazilatga ega bo'lgan ayol edi. U o'z zamonasining ziyrak, quvnoq va badiiy zavqi yuksak bo'lgan savodxon ayollaridan biri bo'lib, dugonalariga ertaklar, naqllar aytib berar, g\u2018azal kitoblarini ogir, tez-tez bo'lib turadigan ayollar o'tirishiga alohida jon va fayz bag'ishlar edi. Bibioysha ishtirok etmagan yig\u2018inlarda uning o'rni yo'qlanar, fazilatlari eslanar edi . Shuning uchun Qo\u2019gon ayollarigs uni sevib va erkalab \xabXumorbibi\xbb deb ataganlar. \n\nXumorbibidagi bu ma\u2019naviy xislat o\u2019g\u2018li Mugimiyga%: ham ta\u2019sir etdi va unda juda erta estetik zavq uyg\u2018onishiga sabab bo'ldi. Muqimiyning oilada onasi vositasida xalq og\u2018zaki ijodining jozibador namunalari bilan, shuningdek, Sharq poeziyasining Hofiz, Alisher Navoiy, Fuzuliy kabi mashhur namoyandalari asarlari bilan tanishishi undagi badiiy zavqini tez rivojlantirdi. Hassos va_ tiyrak Muqimiy  bolalik vaqtidayoq maktabda o\u2018qib yurgan kezlarida \xabshe\u2019r mashqi\xbbga kirishgan edi.",null,B.KG,null,null,null)
